enting on cosplay etc please only give constructive criticism - no hate or trolling - as it will result in a removal warning \\n\\n16. Keep live videos under 15 (age) \\nAnyone doing anything inappropriate will be barred \\nIf you\\u2019re are unsure if your post is allowed please message us and wait patiently for a reply.\",[19,\"508881\"],\"https:\\\/\\\/scontent.fhan14-5.fna.fbcdn.net\\\/v\\\/t39.30808-6\\\/404593601_803299275138921_6802860262098726907_n.jpg?stp=c185.0.480.480a_dst-jpg_s100x100_tt6&_nc_cat=109&ccb=1-7&_nc_sid=1760b9&_nc_eui2=AeGEKtHwYM9lcmDkW8rAsgb-Ymmo3gIr2NdiaajeAivY1_vdgh5tpybN0h26I32ExLSXFq6Zvk_d4XVhtYDBSo8v&_nc_ohc=tm_SPGEoDFUQ7kNvwFqqxxJ&_nc_oc=Adn2-PXUmCMYAgvqmClMNofvKLBuMjmzlmh53HxWa-SH9vI339RMhJumLvPSrJlm0pg&_nc_zt=23&_nc_ht=scontent.fhan14-5.fna&_nc_gid=wYiDCjbqKF_dWbjqnUrVow&oh=00_AfiI8rjSYBeYlosAaJpt5bIWZyuStlzGwas4QtccNXf_-A&oe=6918C4CE\",\"\\\/messaging\\\/lightspeed\\\/media_fallback\\\/?entity_id=578950957475161&entity_type=36&width=100&height=100\",[19,\"1763230926\"],[19,\"1570900348000\"],[19,\"0\"],\"\",[19,\"-8418669126790141928\"],[19,\"59190020224\"],[19,\"0\"],[19,\"3\"],[19,\"0\"],[19,\"0\"],[9],false,\"https:\\\/\\\/m.me\\\/cm\\\/Abal-8Z9gkymtxdQ\\\/\",[19,\"0\"],\"https:\\\/\\\/m.me\\\/cm\\\/Abal-8Z9gkymtxdQ\\\/\",[19,\"1\"],[9],[19,\"2\"],[9],[19,\"9\"],[9],[19,\"0\"],[19,\"0\"],[9],\"https:\\\/\\\/scontent.fhan14-5.fna.fbcdn.net\\\/v\\\/t39.30808-6\\\/404593601_803299275138921_6802860262098726907_n.jpg?_nc_cat=109&ccb=1-7&_nc_sid=0f41b2&_nc_eui2=AeGEKtHwYM9lcmDkW8rAsgb-Ymmo3gIr2NdiaajeAivY1_vdgh5tpybN0h26I32ExLSXFq6Zvk_d4XVhtYDBSo8v&_nc_ohc=tm_SPGEoDFUQ7kNvwFqqxxJ&_nc_oc=Adn2-PXUmCMYAgvqmClMNofvKLBuMjmzlmh53HxWa-SH9vI339RMhJumLvPSrJlm0pg&_nc_zt=23&_nc_ht=scontent.fhan14-5.fna&_nc_gid=wYiDCjbqKF_dWbjqnUrVow&oh=00_AfgaBNywosxlX0tFlaX5WyUQPLTi4F5cDEJoDD2ZNbHiDg&oe=6918C4CE\",\"\\\/messaging\\\/lightspeed\\\/media_fallback\\\/?entity_id=578950957475161&entity_type=36&width=100&height=100\",[19,\"1763230926\"],[9],[9],[19,
